// Navbar component in Navbar.js
import React from 'react';
import { Navbar as BootstrapNavbar, Nav } from 'react-bootstrap'; // Rename the imported Navbar component to avoid conflicts

const Navbar = () => {
  return (
    <div>
      <BootstrapNavbar bg="light" expand="lg">
        <BootstrapNavbar.Brand href="#home">My App</BootstrapNavbar.Brand>
        <BootstrapNavbar.Toggle aria-controls="basic-Navbar-nav" />
        <BootstrapNavbar.Collapse id="basic-Navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="Homepage">Home</Nav.Link>
            <Nav.Link href="aboutpage">About</Nav.Link>
            <Nav.Link href="contactpage">Contact</Nav.Link>
          </Nav>
        </BootstrapNavbar.Collapse>
      </BootstrapNavbar>
    </div>
  );
}

export default Navbar;
